import React from 'react';
import './Header.css';
import model3d from '../assets/final_island_2.glb'

function Header() {
  return (
    <header>
      <div className="logo">Logo</div>
      <h1 className="title">TEAM TREES</h1>
      <p className="quote">"The best time to plant a tree was 20 years ago. The second-best time is now."</p>
      <model-viewer alt="3d model" src={model3d} camera-controls></model-viewer>
    </header>
  );
}

export default Header;
